import React from 'react';
import styled from 'styled-components';
import genres from '../data';

const Container = styled.div`
  width: 1230px;
  margin: auto;
  margin-top: 10px;
  background-color: white;
`;
const TitleContainer = styled.div`
  display: flex;
  align-items: center;
`;
const Title = styled.div`
  margin: 15px;
  font-size: 25px;
`;
const GenresContainer = styled.div``;
const IteamContainer = styled.div``;
const Image = styled.div``;
const Name = styled.p``;

const Genres = () => {
  return (
    <Container>
      <TitleContainer>
        <Title>Book Genres</Title>
      </TitleContainer>
      <hr />
      <GenresContainer>{
        genres.map((item)=>(
          <IteamContainer key={item.id}>
            <Image>{item.img}</Image>
            <Name>
              {}
            </Name>
          </IteamContainer>
        ))}</GenresContainer>
    </Container>
  );
};

export default Genres;
